/* harmony default export */ __webpack_exports__["default"] = ("<body>\n  <div class=\"container\">\n  <h1><b>Welcome to our Privacy Policy</b></h1> <button type=\"button\" routerLink='/home' class=\"btn btn-info\">< Back</button>\n  <h3>Your privacy is critically important to us.</h3>\n  ScriptChain is located at:<br/>\n  <address>\n   ScriptChain<br/>Boston <br />- Massachusetts , United States<br/>9252062904 </address>\n  \n  <p>It is ScriptChain's policy to respect your privacy regarding any information we may collect while operating our website. This Privacy Policy applies to <a href=\"https://www.scriptchain.co\" target=\"blank\">https://www.scriptchain.co</a> (hereinafter, \"us\", \"we\", or \"https://www.scriptchain.co\"). We respect your privacy and are committed to protecting personally identifiable information you may provide us through the Website. We have adopted this privacy policy (\"Privacy Policy\") to explain what information may be collected on our Website, how we use this information, and under what circumstances we may disclose the information to third parties. This Privacy Policy applies only to information we collect through the Website and does not apply to our collection of information from other sources.</p>\n  <p>This Privacy Policy, together with the Terms and conditions posted on our Website, set forth the general rules and policies governing your use of our Website. Depending on your activities when visiting our Website, you may be required to agree to additional terms and conditions.</p>\n  \n  <h2><b>Website Visitors</b></h2>\n  <p>Like most website operators, ScriptChain collects non-personally-identifying information of the sort that web browsers and servers typically make available, such as the browser type, language preference, referring site, and the date and time of each visitor request. ScriptChain's purpose in collecting non-personally identifying information is to better understand how ScriptChain's visitors use its website. From time to time, ScriptChain may release non-personally-identifying information in the aggregate, e.g., by publishing a report on trends in the usage of its website.</p>\n  <p>ScriptChain also collects potentially personally-identifying information like Internet Protocol (IP) addresses for logged in users and for users leaving comments on https://www.scriptchain.co blog posts. ScriptChain only discloses logged in user and commenter IP addresses under the same circumstances that it uses and discloses personally-identifying information as described below.</p>\n  \n  <h2><b>Gathering of Personally-Identifying Information</b></h2>\n  <p>Certain visitors to ScriptChain's websites choose to interact with ScriptChain in ways that require ScriptChain to gather personally-identifying information. The amount and type of information that ScriptChain gathers depends on the nature of the interaction. For example, we ask visitors who sign up for a blog at https://www.scriptchain.co to provide a username and email address.</p>\n  \n  <h2><b>Security</b></h2>\n  <p>The security of your Personal Information is important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</p>\n  \n  <h2><b>Advertisements</b></h2>\n  <p>Ads appearing on our website may be delivered to users by advertising partners, who may set cookies. These cookies allow the ad server to recognize your computer each time they send you an online advertisement to compile information about you or others who use your computer. This information allows ad networks to, among other things, deliver targeted advertisements that they believe will be of most interest to you. This Privacy Policy covers the use of cookies by ScriptChain and does not cover the use of cookies by any advertisers.</p>\n  \n  \n  <h2><b>Links To External Sites</b></h2>\n  <p>Our Service may contain links to external sites that are not operated by us. If you click on a third party link, you will be directed to that third party's site. We strongly advise you to review the Privacy Policy and terms and conditions of every site you visit.</p>\n  <p>We have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites, products or services.</p>\n  \n  \n  <h2><b>Protection of Certain Personally-Identifying Information</b></h2>\n  <p>ScriptChain discloses potentially personally-identifying and personally-identifying information only to those of its employees, contractors and affiliated organizations that (i) need to know that information in order to process it on ScriptChain's behalf or to provide services available at ScriptChain's website, and (ii) that have agreed not to disclose it to others. Some of those employees, contractors and affiliated organizations may be located outside of your home country; by using ScriptChain's website, you consent to the transfer of such information to them. ScriptChain will not rent or sell potentially personally-identifying and personally-identifying information to anyone. Other than to its employees, contractors and affiliated organizations, as described above, ScriptChain discloses potentially personally-identifying and personally-identifying information only in response to a subpoena, court order or other governmental request, or when ScriptChain believes in good faith that disclosure is reasonably necessary to protect the property or rights of ScriptChain, third parties or the public at large.</p>\n  <p>If you are a registered user of https://www.scriptchain.co and have supplied your email address, ScriptChain may occasionally send you an email to tell you about new features, solicit your feedback, or just keep you up to date with what's going on with ScriptChain and our products. We primarily use our blog to communicate this type of information, so we expect to keep this type of email to a minimum. If you send us a request (for example via a support email or via one of our feedback mechanisms), we reserve the right to publish it in order to help us clarify or respond to your request or to help us support other users. ScriptChain takes all measures reasonably necessary to protect against the unauthorized access, use, alteration or destruction of potentially personally-identifying and personally-identifying information.</p>\n  \n  <h2><b>Aggregated Statistics</b></h2>\n  <p>ScriptChain may collect statistics about the behavior of visitors to its website. ScriptChain may display this information publicly or provide it to others. However, ScriptChain does not disclose your personally-identifying information.</p>\n  \n  \n  <h2><b>Cookies</b></h2>\n  <p>To enrich and perfect your online experience, ScriptChain uses \"Cookies\", similar technologies and services provided by others to display personalized content, appropriate advertising and store your preferences on your computer.</p>\n  <p>A cookie is a string of information that a website stores on a visitor's computer, and that the visitor's browser provides to the website each time the visitor returns. ScriptChain uses cookies to help ScriptChain identify and track visitors, their usage of https://www.scriptchain.co, and their website access preferences. ScriptChain visitors who do not wish to have cookies placed on their computers should set their browsers to refuse cookies before using ScriptChain's websites, with the drawback that certain features of ScriptChain's websites may not function properly without the aid of cookies.</p>\n  <p>By continuing to navigate our website without changing your cookie settings, you hereby acknowledge and agree to ScriptChain's use of cookies.</p>\n  \n  \n  \n  <h2><b>Privacy Policy Changes</b></h2>\n  <p>Although most changes are likely to be minor, ScriptChain may change its Privacy Policy from time to time, and in ScriptChain's sole discretion. ScriptChain encourages visitors to frequently check this page for any changes to its Privacy Policy. Your continued use of this site after any change in this Privacy Policy will constitute your acceptance of such change.</p>\n  \n  \n   \n   <h2><b>Medical Privacy</b></h2>  \n    <p>maintaining the security and confidentiality of patient records. It involves both the conversational discretion of health care providers and the security of medical records. We are storing the medical data in the blockchain where it is being held and maintained by GCP and comply with HIPAA.</p>\n  \n  <h2><b>Credit & Contact Information</b></h2>\n  <p>This privacy policy was created at <a style=\"color:inherit;text-decoration:none;\" href=\"https://termsandconditionstemplate.com/privacy-policy-generator/\" title=\"Privacy policy template generator\" target=\"_blank\">termsandconditionstemplate.com</a>. If you have any questions about this Privacy Policy, please contact us via <a href=\"mailto:Moh@scriptchain.co\">email</a> or <a href=\"tel:9252062904\">phone</a>.</p>\n  </div>\n  \n  \n  </body>");

